import React from "react";

const SearchResults = ({
  themeName,
  name,
  year,
  theme_id,
  num_parts,
}) => {
  return (
    <div>
      <ul>
        <li>Name: {name}</li>
        <li>Year Released: {year}</li>
        <li>Theme Name: {themeName}</li>
        <li>Number of Parts: {num_parts}</li>
      </ul>
    </div>
  );
};

export default SearchResults;
